import React from 'react';
import "./Footer.css"

const Footer = () => {
 
    return (
        <div className="footer">
            <h1 className="text-center"><span className="text-red">Fitness</span> 101</h1>
            <h5 className="text-center">All rights reserved.</h5>
        </div>
    );
};

export default Footer;
